'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1547181","type":"CustomJS"},{"attributes":{},"id":"1547055","type":"RedoTool"},{"attributes":{},"id":"1547171","type":"AllLabels"},{"attributes":{"below":[{"id":"1547134"}],"center":[{"id":"1547137"},{"id":"1547141"},{"id":"1547175"}],"height":90,"left":[{"id":"1547138"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"1547162"}],"sizing_mode":"stretch_width","title":{"id":"1547164"},"toolbar":{"id":"1547150"},"toolbar_location":null,"width":null,"x_range":{"id":"1546994"},"x_scale":{"id":"1547130"},"y_range":{"id":"1547128"},"y_scale":{"id":"1547132"}},"id":"1547126","subtype":"Figure","type":"Plot"},{"attributes":{"data":{"datetime":{"__ndarray__":"","dtype":"float64","order":"little","shape":[0]},"exit_price":{"__ndarray__":"","dtype":"float64","order":"little","shape":[0]},"index":{"__ndarray__":"","dtype":"float64","order":"little","shape":[0]},"position_lines_xs":[],"position_lines_ys":[],"returns_positive":[],"size":{"__ndarray__":"","dtype":"float64","order":"little","shape":[0]}},"selected":{"id":"1547122"},"selection_policy":{"id":"1547121"}},"id":"1547028","type":"ColumnDataSource"},{"attributes":{"data":{"Close":{"__ndarray__":"UrgeheuBb0D2KFyPwtVuQLgehetRCG9ApHA9Ctfzb0CamZmZmelvQOxRuB6FI3BAuB6F61EYcEC4HoXrUWhwQI/C9Shcp3BAMzMzMzPLcEAK16NwPdpwQBSuR+F68HBAMzMzMzP7cEBSuB6F63VwQKRwPQrXh3BAUrgehevRcEDsUbgehetwQK5H4XoUvnBArkfhehTmcEA9CtejcNlwQGZmZmZmonBAPQrXo3DxcEAK16NwPQZxQI/C9Shcu3BAPQrXo3CxcEDNzMzMzMhwQHsUrkfhmnBAcT0K16OUcECF61G4HjVwQJqZmZmZMXBASOF6FK43cECamZmZmYVwQBSuR+F6qHBAw/
